import React, { Component } from 'react';

class EvenBind extends Component {

    constructor(props){
        super(props)
        this.state={
            message: 'hello'
        }

    }


    render() {
        return (
            <div>
                <button>Click</button>
            </div>
        );
    }
}

export default EvenBind;
